<template>
  <div
    style="background-image: url(/static/img/bjImg.png);background-size: 390px 285px;margin-right:15px;"
  >
    <div class="close" :class="{'show-close': isShowClose}">
      <i @click="closeModel" class="el-icon-close closeStyle"></i>
    </div>
    <div class="inputSearch">
      <el-form
        :model="ruleForm"
        :rules="rules"
        ref="ruleForm"
        status-icon
        @submit.native.prevent
        :show-message="false"
        style="margin-bottom: 5px;"
        @keyup.enter.native="callPhone"
      >
        <el-form-item prop="phoneNumber">
          <el-input
            v-model="ruleForm.phoneNumber"
            ref="inputNumber"
            style="width: 212px;height: 30px"
            size="mini"
            placeholder="请输入号码"
            autofocus
          ></el-input>
        </el-form-item>
      </el-form>
    </div>
    <div style="width: 100%">
      <div style="width: 215px;margin: 0 auto;height: 214px">
        <div class="numberPlan">
          <div v-for="(item ,index) in numberTopArr" :key="index">
            <div
              v-model="item.number"
              :key="index"
              @click="numberClick(item ,index)"
              class="numberStyle"
              :style="{ 'backgroundImage' : 'url(' + item.url + ')' , 'background-size':'65px 37px',
                   'background-position':'center center'}"
            ></div>
          </div>

          <!--下面的符号-->
          <div>
            <div class="numberPlan">
              <div class="numberStyle"></div>

              <!--                :class="{'hide-dialing' : isShowClose}"-->
              <div
                class="numberStyle"
                :class="{'hide-dialing' : isShowClose}"
                @click="dialing('ruleForm')"
                :style="{ 'backgroundImage' : 'url(' + dialOutUrl + ')' , 'background-size':'65px 37px',
                   'background-position':'center center','margin-left': '10px'}"
              ></div>

              <div
                class="numberStyle"
                style="margin-left: 6px;"
                :class="{'hide-dialing' : !isShowClose}"
              >
                <!-- <el-button size="small" type="success" @click="dialing('ruleForm')">添加号码</el-button> -->
                <img
                  src="/static/img/ConvergedCommunication/phone.png"
                  alt
                  srcset
                  style="margin:-5px 0 0 2px;"
                  @click="callPhone()"
                />
              </div>

              <div
                class="bottomStyle"
                @click="handleDeleteNum"
                :style="{ 'backgroundImage' : 'url(' + dialDelectUrl + ')' , 'background-size':'45px 27px',
                   'background-position':'center center'}"
              ></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
export default {
    name: 'dialPlate',
    props: ['isShowClose'],
    data() {
        let number = (rule, value, callback) => {
            let num = /^[0-9*,，]+$/;
            let n = value.match(num);
            if (n == null) {
                callback(new Error('请输入正确的电话号码!'));
            }
            callback();
        };
        return {
            ruleForm: {
                phoneNumber: '', // 输入号码
            },
            rules: {
                phoneNumber: [{ validator: number, trigger: 'blur' }],
            },
            numberTopArr: [
                {
                    number: '1',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '2',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '3',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '4',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '5',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '6',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '7',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '8',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '9',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '*',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '0',
                    url:
                        'data:image/png;base64,',
                },
                {
                    number: '#',
                    url:
                        'data:image/png;base64,',
                },
            ],
            dialOutUrl:
                'data:image/png;base64,', // 拨出图片
            dialDelectUrl:
                'data:image/png;base64,', // 删除图片
        };
    },
    created() {
        console.log(this.isShowClose);
    },
    computed: {
        numberValue() {
            return this.ruleForm.phoneNumber;
        },
    },
    watch: {
        numberValue(newval, oldval) {
            this.ruleForm.phoneNumber = newval.replace(/[^0-9*#，,]/, '');
        },
    },
    methods: {
        numberClick(item, index) {
            console.log('item: ', item);
            this.$refs.inputNumber.focus();
            this.ruleForm.phoneNumber += item.number;
        },
        closeModel() {
            this.$refs.ruleForm.resetFields();
            this.$emit('closeModel');
        },
        //拨号

        callPhone() {
            if (this.ruleForm.phoneNumber.length == 0) {
                this.$message.warning('输入不能为空');
            } else {
                const reg = /[^\d+(,\d\d\d)*.\d+$]/g;
                if (reg.test(this.ruleForm.phoneNumber)) {
                    this.$message.warning(
                        '仅允许输入数字',
                        -',多个手机号请以逗号隔开'
                    );
                } else {
                    this.$emit('callPhone', this.ruleForm.phoneNumber);
                    this.ruleForm.phoneNumber = '';
                }
            }
        },

        handleDeleteNum() {
            if (this.ruleForm.phoneNumber.length !== 0) {
                this.$refs.inputNumber.focus();
                this.ruleForm.phoneNumber = this.ruleForm.phoneNumber.substr(
                    0,
                    this.ruleForm.phoneNumber.length - 1
                );
            }
            if (['', null].includes(this.ruleForm.phoneNumber)) {
                this.$refs.inputNumber.blur();
            }
        },
    },
};
</script>

